🤍Still can’t believe I get to be a @ufc fighter🤍 
Worked my entire life believing in myself. Everyday excited to train! Excited to be here and get to do what I love!!! 
Being a dancer truly gave me perspective on things. It showed me my alternatives. It kept me hungry to make these dreams come true. 

People aren’t always going to see your vision. They don’t need to validate your journey. In fact, almost everyone in my life discouraged mine. 

It was for me to know I could. For me to show other people if it became possible against all the odds for someone like myself, I know they too can accomplish their own type of greatness. 

